    return (
        <div>
            <h2>Notes</h2>

            <p>
              <label>
                <a className="material-icons"
                  onClick={() => {
                    let text = "sample text";
                    addNote(id, text);
                  }}
                >
                <span>Add Note</span>
                </a>
              </label>
            </p>
        </div>
    )
}

export default ViewNotes
